import axios from "axios"

export default function retrievePets() {
    return axios.get('http://localhost:9000/catalog/list?pageNo=1&pageSize=10', {
        headers: {
            'Authorization': 'Bearer ' + sessionStorage.getItem("bearer-token")
        }
      })
}
